aws:cdk:cloudformation:props.definition:
schema {
  query: Query
}
type TimeWatts {
  time: String!
  watts: Float!
  wattHour: Float!
}
type PowerEdge {
  node: TimeWatts!
  cursor: String!
}
type PageInfo {
  previousPageCursor: String
  nextPageCursor: String
}
type PowerConnection {
  edges: [PowerEdge!]
  nodes: [TimeWatts!]
  totalCount: Int!
  pageInfo: PageInfo
}
enum MeterType {
  PRODUCTION
  CONSUMPTION
  SELF_CONSUMPTION
  FEED_IN
  PURCHASED
}
enum SummaryType {
  DAILY_AVERAGE
}
input PowerFilterInput {
  startDate: AWSDate!
  endDate: AWSDate!
  meterType: MeterType!
  summaryType: SummaryType!
}
type Site {
  id: String!
  startDate: AWSDate!
  contactName: String!
  contactEmail: String!
  timeZoneId: String!
  lastAggregationDate: String
  lastSummaryDate: String
  lastRefreshDateTime: String
  power(limit: Int startCursor: String filter: PowerFilterInput!): PowerConnection!
}
type Query {
  site(id: String!): Site!
  uploadUrl(input: UploadUrlInput!): String!
  uploadMultiPartUrls(input: UploadMultiPartInput!): UploadMultiParts!
  uploadMultiPartAbort(input: UploadMultiPartAbortInput!): String!
  uploadMultiPartComplete(input: UploadMultiPartCompleteInput!): String!
  downloadUrl(filename: String!): String!
}
input UploadUrlInput {
  filename: String!
}
type UploadMultiPart {
  partNumber: Int!
  url: String!
}
type UploadMultiParts {
  uploadId: String!
  parts: [UploadMultiPart!]
}
input UploadMultiPartInput {
  filename: String!
  partCount: Int!
}
input UploadMultiPartAbortInput {
  filename: String!
  uploadId: Int!
}
input UploadMultiPartETagInput {
  partNumber: Int!
  eTag: String!
}
input UploadMultiPartCompleteInput {
  filename: String!
  uploadId: Int!
  eTags: [UploadMultiPartETagInput!]
}
